    <trace from=".C4 > .pin2" to="net.GND" />
    <trace from=".C5 > .pin2" to="net.GND" />
    <trace from=".C6 > .pin2" to="net.GND" />
    <trace from=".C7 > .pin2" to="net.GND" />
    <trace from=".C8 > .pin2" to="net.GND" />
    <trace from=".C9 > .pin2" to="net.GND" />
    <trace from=".C10 > .pin2" to="net.GND" />

    {/* ========== USB DATA CONNECTIONS ========== */}

    {/* USB D+ through 27 ohm resistor */}
    <trace from=".J1 > .DP1" to=".R2 > .pin1" />
    <trace from=".R2 > .pin2" to=".U1 > .USB_DP" />

    {/* USB D- through 27 ohm resistor */}
    <trace from=".J1 > .DN1" to=".R3 > .pin1" />
    <trace from=".R3 > .pin2" to=".U1 > .USB_DM" />

    {/* USB-C CC pull-down resistors */}
    <trace from=".J1 > .CC1" to=".R4 > .pin1" />
    <trace from=".R4 > .pin2" to="net.GND" />
    <trace from=".J1 > .CC2" to=".R5 > .pin1" />
    <trace from=".R5 > .pin2" to="net.GND" />

